import TopBar from "./components/TopBar";  // Importing the TopBar component
import Accordion from "./components/Accordion";  // Importing the Accordion component


function App() {
    return (
        <div className="bg-black min-h-screen">
            <TopBar />   {/* Renders the navigation bar */}
            <div className="pt-24">
              {/* Accordion for Artwork Section */}
                <Accordion 
                    title="ARTWORK" 
                    imageSrc="/images/esofon.jpg" 
                    content={
                        <iframe 
                          width="420" 
                          height="345" 
                          src="https://www.youtube.com/embed/Ffe-7T6yDhU"
                          title="Artwork Video"
                        ></iframe>
                    }
                />

                {/* Accordion for Performances Section */}
                <Accordion 
                    title="PERFORMANCES" 
                    imageSrc="/images/performances.jpeg" 
                    content={<p>This is the Performances section content.</p>}
                />
            </div>
        </div>
    );
}

export default App;  // Exporting App component
